import './Hello.css'
import Card from 'react-bootstrap/Card'

const Hello = (props) => {
	return (
		<Card style={{ width: '18rem' }}>
		  <Card.Img variant="top" src="/Users//Downloads/imsky-holder-4c0c932/test/renderperf/releases/holder-master/holder.js/100px180" />
		  <Card.Body>
		    <Card.Title>Card Title</Card.Title>
		    <Card.Text>
		      Some quick example text to build on the card title and make up the bulk of
		      the card's content.
		    </Card.Text>
		  </Card.Body>
		</Card>
	);
}

export default Hello;
